	  "2.95 USD; 4.75 CAD",56.000,NULL,"Based on characters and concepts first introduced in Kingdom Come (DC 1996 series) #1-4. Story continues in The Kingdom: Son of the Bat; The Kingdom: Nightstar; The Kingdom: Kid Flash; The Kingdom: Offspring; and The Kingdom: Planet Krypton.",
	  NULL,NULL,76194121655300111,NULL,1998,"Approved by the Comics Code Authority"
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
