	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  128522,"2",76,NULL,1938,
	  "0.10 USD",100.000,NULL,"This comic either has no indicia or it is on the page that is missing from the indexed copy (more on this a few paragraphs down).  If the indicia is absent and not simply missing from the available copy the publisher of record is difficult to discern.  It was most likely Nicholson Publishing Co. Inc. which has been publishing More Fun Comics and New Comics for the past year and a quarter starting approximately with the issues reprinted herein.  However this \"Spring 1938\" cover date arguably aligns with the March-April and May 1938 cover-dated issues published by A.I. Menin rec. Nicholson Publishing Co. Inc. while Nicholson Pub. Co. Inc. was in bankruptcy.  The relationship between the publication of this issue and the bankruptcy proceedings and purchase of Nicholson's titles by Detective Comics Inc. is unclear.As mentioned the copy from which this index was made is missing a single leaf (2 pages by our counting) but the structure of the book makes it possible to figure out which sheet (it's not obvious just at a glance).  The book consists of reprints of the outermost wraps of More Fun Comics #v2#3 [15] and #v2#4 (16) (with the latter nested inside the former) followed by the outermost wraps of New Comics #11.This is *not* a rebinding as some ads have been changed and the \"It's a Dern Lie\" feature on the final page of New Comics #11 has been replaced by an ad.  The first sheet of the New Comics #11 wraps is the one missing- the 2nd page of it is obvious as it's an otherwise missing story page.  The first page was originally an ad.  A reasonable theory would be that it simply switched places with the \"It's a Dern Lie\" feature that should be on the final page- although the ad that appears on that final page here is a different Johnson & Co. ad than the one that appeared on the first interior page of New Comics #11.Another possibility is that a text page including the indicia was printed here as an extended indicia typically appeared on an interior text page during the period from which these stories were reprinted.  However other Nicholson publications with similar cover dates used the inside front cover for their indicia.  The inside front and back covers of this issue are completely blank and the cover is made of a stiffer tagboard than the usual cover stock.Other changes for these reprints include an apparent new filler in the centerfold of the 64-page quire that holds reprints the wraps from the two More Fun issues.  Also at the border between those two issues is a wrap with outer pages from #v2#3 [15] and inner pages from #v2#4 (16) clear proof that the originally printed signatures were not just rebound.  Oddly the inner break in the New Comics #11 quire does not line up with the feature boundary splicing a page off of each of the adjacent features.",
	  NULL,NULL,NULL,NULL,NULL,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
