	  "14.95 USD",196.000,NULL,"Collects the complete run of \"Tales of the Bizarro World\" back-up stories from Adventure Comics #285-299 (June 1961 - August 1962).",
	  NULL,NULL,NULL,NULL,2000,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  132099,"[1]",11122,NULL,1940,
	  "0.00 FREE",16.000,"weekly","Intended to be a section within a newspaper so it has no separate price and probably no recognizable indicia.  While Fox's comic book publishing company at the time was Fox Publications Inc. his newspaper strips bore the name \"Fox Feature Syndicate\".The publication date was within Joe Simon's tenure at Fox although whether he edited this venture or not is unclear.Note that both \"issues\" of this series list the same publication date.",
	  NULL,NULL,NULL,NULL,1940,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  132100,"[2]",11122,NULL,1940,
	  "0.00 FREE",16.000,"weekly","Intended to be a section within a newspaper so it has no separate price and probably no recognizable indicia.  While Fox's comic book publishing company at the time was Fox Publications Inc. his newspaper strips bore the name \"Fox Feature Syndicate\".The publication date was within Joe Simon's tenure at Fox although whether he edited this venture or not is unclear.Note that both versions of this have the same publication date.Sequence order unknown except for the model activity on the back cover.  Setting the page count at 2 per feature is only a guess.  A Heritage auction listing indicated that there are in fact seven features within this version presumably matching the seven on the cover although it's possible that that is incorrect.",
	  NULL,NULL,NULL,NULL,1940,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  132101,"3",11121,NULL,1940,
	  NULL,16.000,"weekly","Data from Don Maris. Publisher & date information not found on copy of what is called by the Overstreet Comic Book Price Guide as Version 3 (Captain Valor version) of \"Weekly Comic Magazine\".  See http://www.comics.org/series/11122/ for that series which contains material from Fox Publications in two issues that Overstreet refers to a Version 1 and Version 2.  Note that the date here is copied from those versions and there is no clear indication that this version was actually intended for the same date.  The similarities extend only as far as the general format and some aspects of the title and trade dress.This version was distributed through Rogers Jewelry Stores in New England region and contains reprint from an MLJ (Archie) series. Cover contains mostly ad information for Rogers Jewelry Stores.Per Frank Motler there is a small number 3 at the bottom of the back cover from which the issue number is taken.",
	  NULL,NULL,NULL,NULL,1940,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
