	  132298,"25",11132,1072,1964,
	  "0.25 USD",100.000,NULL,"Indicia title is \"Dennis the Menace In Mexico\".  Even though the cover states this is the 2nd printing it is actually the 3rd.  \"Dennis the Menace Giant\" #8 was printed in Winter 1960 (1st printing) and Summer 1962 (2nd printing).Indicia: \"DENNIS THE MENACE IN MEXICO a magazine published 1960 by Hallden Division of Fawcett Publications Inc. 163 Pratt Street Meriden Conn. Editorial and Executive offices 67 West 44th Street New York 36 N.Y. Copyright 1960 by the Hall Syndicate Inc. All rights reserved. No. 25 Summer 1964. PRINTED IN THE U.S.A. by the Eastern Color Printing Co. Waterbury 20 Conn.\"",
	  NULL,NULL,NULL,NULL,NULL,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  132299,"26",11132,1072,1964,
	  "0.25 USD",84.000,NULL,"This is an exact reprint of Dennis the Menace Giant (Hallden; Fawcett 1958 series) #15 (summer 1963) with these exceptions. (1) Numbering on cover (2) Slight changes such as date and numbering in indicia (3) Changes to two pages of Sequence 5 The White House. On going upstairs Dennis converses with a Secret Service agent in this issue rather than encountering the Kennedys. President Kennedy had been killed in the year between the two publications. Lyndon Johnson (in fact President by this time) continues to preside over the Senate in Sequence 6 The Capitol.",
	  NULL,NULL,NULL,NULL,1964,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
